import React from 'react'
import './index.css'

import logo from '../../assets/images/logo.png'

function Login(){
    return (

        <div id="page-login-content"  >
            <img src={logo} className="logo"/>

            <text></text>
            <input className="input"/>

        </div>

    )
}

export default Login;
